import React, { useEffect } from 'react';
import SectionHeader from '../../components/SectionHeader/SectionHeader';
import ServiceCard from '../../components/ServiceCard/ServiceCard';
import ComparisonChart from '../../components/ComparisonChart/ComparisonChart';
import { useThemeSettings } from '../../context/ThemeSettingsContext';
import { ReactComponent as GoldIcon } from '../../assets/icons/gold-icon.svg';
import { ReactComponent as SilverIcon } from '../../assets/icons/silver-icon.svg';
import { ReactComponent as BronzeIcon } from '../../assets/icons/bronze-icon.svg';
import { ReactComponent as PlatinumIcon } from '../../assets/icons/platinum-icon.svg';
import { ReactComponent as WebDevelopmentIcon } from '../../assets/icons/web-development-icon.svg';
import { ReactComponent as LandingPageIcon } from '../../assets/icons/landing-page-icon.svg';
import { ReactComponent as SeoIcon } from '../../assets/icons/seo-icon.svg';
import { ReactComponent as EcommerceIcon } from '../../assets/icons/ecommerce-icon.svg';
import { ReactComponent as AdvancedLandingPageIcon } from '../../assets/icons/advanced-landing-page-icon.svg';
import { ReactComponent as WebAppIcon } from '../../assets/icons/web-app-icon.svg';
import { ReactComponent as EnterpriseWebIcon } from '../../assets/icons/enterprise-web-icon.svg';
import { ReactComponent as SaasIcon } from '../../assets/icons/saas-icon.svg';
import { ReactComponent as DigitalTransformationIcon } from '../../assets/icons/digital-transformation-icon.svg';

import AOS from 'aos';
import 'aos/dist/aos.css';

import './ServicesPage.css';

const badgeNames = ['Bronze', 'Silver', 'Gold', 'Platinum'];

const assignRelativeBadges = (services) => {
  // Sort services by numeric price
  const sortedServices = [...services].sort((a, b) => {
    const priceA = parseFloat(
      a.price.replace('$', '').replace('+', '')
    );
    const priceB = parseFloat(
      b.price.replace('$', '').replace('+', '')
    );
    return priceA - priceB;
  });

  // Assign badges based on position in the sorted list
  const tierSize = sortedServices.length;
  sortedServices.forEach((service, index) => {
    const badgeIndex = Math.floor(
      (index / (tierSize - 1)) * (badgeNames.length - 1)
    );
    service.badgeName = badgeNames[badgeIndex];
  });

  return sortedServices;
};

const servicesData = [
  {
    tier: 'Freshman',
    services: assignRelativeBadges([
      {
        title: 'Starter Pack',
        description:
          'Simple 3-5 page static website with responsive design and basic contact form.',
        details: [
          'Responsive design for desktop and mobile',
          'Up to 3 custom pages',
          'Basic contact form',
          'SEO-friendly structure',
          '1 round of revisions',
        ],
        price: '$1,000',
        IconComponent: WebDevelopmentIcon,
      },
      {
        title: 'On the Come Up',
        description:
          'Single-page landing site with form capture and minimal animations.',
        details: [
          'Conversion-focused design',
          'Form integration with email capture',
          'Basic on-page SEO',
          '1 round of revisions',
        ],
        price: '$800',
        IconComponent: LandingPageIcon,
      },
      {
        title: 'Kickstart',
        description:
          'On-page SEO optimization and submission to Google Search Console.',
        details: [
          'Keyword research and implementation',
          'Meta tag creation',
          'Google Search Console submission',
          'Basic website audit report',
        ],
        price: '$500',
        IconComponent: SeoIcon,
      },
      {
        title: 'Breakthrough',
        description: 'Basic business branding and content strategy.',
        details: [
          'Logo design',
          'Basic brand guidelines',
          'Initial content strategy',
          '1 round of revisions',
        ],
        price: '$750',
        IconComponent: SeoIcon,
      },
    ]),
  },
  {
    tier: 'Prime Time',
    badgeIcon: SilverIcon,
    services: [
      {
        title: 'Grind Mode',
        description:
          '5-10 pages with CMS integration, basic e-commerce, and SEO.',
        details: [
          'Custom CMS integration (WordPress, Joomla)',
          'Up to 10 pages with content management',
          'Basic e-commerce functionality',
          'On-page SEO optimization',
          '3 rounds of revisions',
        ],
        price: '$4,500',
        IconComponent: EcommerceIcon,
      },
      {
        title: 'Level Up',
        description:
          'Optimized for conversions, integrated with CRM, and advanced animations.',
        details: [
          'High-conversion design',
          'Integration with CRM (Salesforce, HubSpot)',
          'Advanced animations and interactivity',
          'A/B testing setup',
          '3 rounds of revisions',
        ],
        price: '$3,000',
        IconComponent: AdvancedLandingPageIcon,
      },
      {
        title: 'Growth Spurt',
        description:
          'Full-stack web application with user authentication and dashboard.',
        details: [
          'Custom backend development (Node.js, Python)',
          'User authentication (OAuth, JWT)',
          'Admin and user dashboards',
          'Database integration (MongoDB, MySQL)',
          'API integrations',
        ],
        price: '$6,000',
        IconComponent: WebAppIcon,
      },
      {
        title: 'Next Up',
        description: 'Advanced marketing strategy and analytics.',
        details: [
          'Marketing automation setup',
          'Advanced analytics tracking',
          'Email marketing integration',
          '2 rounds of revisions',
        ],
        price: '$5,000',
        IconComponent: SeoIcon,
      },
    ],
  },
  {
    tier: 'Mogul',
    badgeIcon: GoldIcon,
    services: [
      {
        title: 'Boss Moves',
        description:
          '20+ pages with fully customized design, advanced e-commerce, and SEO.',
        details: [
          'Fully customized design and UX',
          'Advanced e-commerce platform (Shopify, WooCommerce)',
          '20+ pages with content management',
          'Advanced on-page and technical SEO',
          'Ongoing maintenance and support',
        ],
        price: '$15,000',
        IconComponent: EnterpriseWebIcon,
      },
      {
        title: 'Empire State',
        description:
          'Full-featured SaaS platform with API integration and advanced user roles.',
        details: [
          'Custom SaaS platform development',
          'API integration with third-party services',
          'Advanced user role management',
          'Multi-tenant architecture',
          'Ongoing support and feature updates',
        ],
        price: '$20,000+',
        IconComponent: SaasIcon,
      },
      {
        title: 'Heavyweight',
        description:
          'Full business process automation and ongoing support.',
        details: [
          'Business process analysis and optimization',
          'Automation of key business functions',
          'Implementation of cloud solutions (AWS, Azure)',
          'Employee training and support',
          'Ongoing consulting and maintenance',
        ],
        price: '$25,000+',
        IconComponent: DigitalTransformationIcon,
      },
      {
        title: 'The Big League',
        description:
          'Full enterprise-grade content and brand strategy.',
        details: [
          'Enterprise-level content strategy',
          'Brand management and guidelines',
          'Multi-channel marketing',
          'Ongoing content updates',
        ],
        price: '$30,000+',
        IconComponent: SeoIcon,
      },
    ],
  },
  {
    tier: 'Legendary',
    badgeIcon: PlatinumIcon,
    services: [
      {
        title: 'Hall of Fame',
        description:
          'Complete end-to-end digital transformation, including custom SaaS, web applications, and automation.',
        details: [
          'Fully integrated digital ecosystem',
          'Custom SaaS solutions',
          'Advanced AI-driven automation',
          'Enterprise-grade cloud infrastructure',
          'Dedicated support team',
        ],
        price: '$50,000+',
        IconComponent: DigitalTransformationIcon,
      },
      {
        title: 'Iconic',
        description:
          'AI solutions integrated into your business processes for smarter operations.',
        details: [
          'Custom AI models',
          'Process automation with AI',
          'AI-driven decision-making',
          'Ongoing model training and optimization',
          'Dedicated AI support',
        ],
        price: '$60,000+',
        IconComponent: DigitalTransformationIcon,
      },
      {
        title: 'Mastermind',
        description:
          'Leverage blockchain technology for secure, transparent, and automated operations.',
        details: [
          'Custom blockchain solutions',
          'Smart contract development',
          'Secure and transparent transactions',
          'Ongoing blockchain maintenance',
          'Dedicated blockchain support team',
        ],
        price: '$75,000+',
        IconComponent: DigitalTransformationIcon,
      },
      {
        title: 'The Crown',
        description:
          'Exclusive, high-end digital experience and innovation package for industry leaders.',
        details: [
          'Personalized digital strategy',
          'Exclusive features and integrations',
          'Premium content and design',
          'Dedicated innovation team',
        ],
        price: '$100,000+',
        IconComponent: DigitalTransformationIcon,
      },
    ],
  },
];

// Example usage in your data structure

const ServicesPage = () => {
  const themeSettings = useThemeSettings();

  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  return (
    <div
      className="services-page"
      style={{
        backgroundColor: themeSettings.colors.background,
        color: themeSettings.colors.text,
        fontFamily: themeSettings.typography.fontFamily,
      }}
    >
      <SectionHeader
        title="Our Services"
        subtitle="Explore the wide range of services we offer, tailored to meet your needs."
      />
      <div className="services-overview">
        {servicesData.map((tier, index) => (
          <div
            key={index}
            className={`tier-section ${tier.tier
              .toLowerCase()
              .replace(' ', '-')}`}
          >
            <h3
              className="tier-title"
              style={{ color: themeSettings.colors.primary }}
            >
              {tier.tier}
            </h3>
            <div className="service-cards">
              {tier.services.map((service, serviceIndex) => (
                <ServiceCard
                  key={serviceIndex}
                  title={service.title}
                  description={service.description}
                  details={service.details}
                  price={service.price}
                  metric={service.metric}
                  IconComponent={service.IconComponent}
                  badgeIcon={tier.badgeIcon} // Pass badge icon to ServiceCard
                />
              ))}
            </div>
          </div>
        ))}
      </div>
      <ComparisonChart /> {/* Include the comparison chart */}
    </div>
  );
};

export default ServicesPage;
